This week I have NOT BEEN WEIGHED.
Result; √ó.

So, this week I missed weigh in. After having hardly any sleep for days last week I had struggled to stick on plan and didnt have the energy to go and be weighed to be told I had put weight on. So I have took a few days off slimming world to recharge myself - I seem to be feeling better energy wise! I have also had other personal issues that have caused me an amount of stress and worry which resulted me to emotionally eat. I dont know why I do it, its a rubbish habit that I cannot seem to shake off! But i feel like I am set to finish this week in good form! I've had a good day today being back on plan so hopefully this continues.

Target for next week: Maintain.

If i am honest, i will be over the moon with a maintain! The amount of rubbish I have been eating is unreal! So I hope I can rein it back in and any weight I have gained since I was last weighed I can hopefully get off by Tuesday.

